                  {
                    <ReactAnimatedWeather
                      icon='PARTLY_CLOUDY_DAY'
                      color='#EE9945'
                      size={30}
                    />
                  }
                </span>
                <span>
                  <FontAwesomeIcon icon={faLongArrowAltUp} size='xs' />{" "}
                  {props.data.maxTemp}°
                </span>
                {""} / {""}
                <span>
                  <FontAwesomeIcon icon={faLongArrowAltDown} size='xs' />{" "}
                  {props.data.minTemp}°
                </span>
              </p>
            </li>
            <li>
              <p className='temps'>
                {" "}
                19:00{" "}
                <span className='small-icon'>
                  {
                    <ReactAnimatedWeather
                      icon='PARTLY_CLOUDY_DAY'
                      color='#EE9945'
                      size={30}
                    />
                  }
                </span>
                <span>
                  <FontAwesomeIcon icon={faLongArrowAltUp} size='xs' /> 17°
                </span>
                {""} / {""}
                <span>
                  <FontAwesomeIcon icon={faLongArrowAltDown} size='xs' /> 12°
                </span>
              </p>
            </li>
            <li>
              <p className='temps'>
                {" "}
                22:00{" "}
                <span className='small-icon'>
                  {
                    <ReactAnimatedWeather
                      icon='PARTLY_CLOUDY_DAY'
                      color='#EE9945'
                      size={30}
                    />
                  }
                </span>
                <span>
                  <FontAwesomeIcon icon={faLongArrowAltUp} size='xs' /> 15°
                </span>
                {""} / {""}
                <span>
                  <FontAwesomeIcon icon={faLongArrowAltDown} size='xs' /> 10°
                </span>
              </p>
            </li>
            <li>
              <p className='temps'>
                {" "}
                01:00{" "}
                <span className='small-icon'>
                  {
                    <ReactAnimatedWeather
                      icon='PARTLY_CLOUDY_DAY'
                      color='#EE9945'
                      size={30}
                    />
                  }
                </span>
                <span>
                  <FontAwesomeIcon icon={faLongArrowAltUp} size='xs' /> 15°
                </span>
                {""} / {""}
                <span>
                  <FontAwesomeIcon icon={faLongArrowAltDown} size='xs' /> 10°
                </span>
              </p>
            </li>
            <li>
              <p className='temps'>
                {" "}
                04:00{" "}
                <span className='small-icon'>
                  {
                    <ReactAnimatedWeather
                      icon='PARTLY_CLOUDY_DAY'
                      color='#EE9945'
                      size={30}
                    />
                  }
                </span>
                <span>
                  <FontAwesomeIcon icon={faLongArrowAltUp} size='xs' /> 15°
                </span>
                {""} / {""}
                <span>
                  <FontAwesomeIcon icon={faLongArrowAltDown} size='xs' /> 10°
                </span>
              </p>
            </li>
            <li>
              <p className='temps'>
                {" "}
                07:00{" "}
                <span className='small-icon'>
                  {
                    <ReactAnimatedWeather
                      icon='PARTLY_CLOUDY_DAY'
                      color='#EE9945'
                      size={30}
                    />
                  }
                </span>
                <span>
                  <FontAwesomeIcon icon={faLongArrowAltUp} size='xs' /> 15°
                </span>
                {""} / {""}
                <span>
                  <FontAwesomeIcon icon={faLongArrowAltDown} size='xs' /> 10°
                </span>
              </p>
            </li>
          </ul>
        </div>
      </div>
    </div>
  );
}
